describe('SystemSettings: Security Policy', () => {
  const tabs = new SystemSettingsTabs();
  const page = new SecurityPolicyPo();
  const modal = new SecurityPolicyModal();

  const initTest = getSecurityPolicyResponse => {
    const getSecurityPolicyRouteMatcher = {
      method: 'GET',
      pathname: '/api/v2/iam/config/security-policy',
    };

    if (getSecurityPolicyResponse) {
      cy.intercept(getSecurityPolicyRouteMatcher, getSecurityPolicyResponse).as(
        'loadSecurityPolicy'
      );
    } else {
      cy.intercept(getSecurityPolicyRouteMatcher).as('loadSecurityPolicy');
    }

    cy.visit('/portal/orgs/org1/security');
    tabs.getSecurityPolicyTab().click();
    cy.wait('@loadSecurityPolicy');
    cy.wait('@loadMinTlsVersion');
  };

  beforeEach(() => {
    cy.intercept({
      method: 'GET',
      pathname: '/api/v2/ingress-authz/min-tls-version',
      times: 1,
    }).as('loadMinTlsVersion');
  });

  it('Check initial values are for time fields that have value more than 1', () => {
    const getSecurityPolicyResponse = {
      account_lockout_time: 43200,
      permanent_lockout: true,
      session_idle_time: 1800,
      max_login_failures: 5,
      max_session_time: 172800,
    };

    initTest(getSecurityPolicyResponse);
    page.getStnMaxLoginFailure().should('contain.text', 5);
    page.getStnMaxSessionTime().should('contain.text', '2 Days');
    page.getStnSessionIdleTime().should('contain.text', '30 Minutes');
    page.getStnPermanentLockout().should('contain.text', 'Enabled');
    page.getStnAccountLockoutTime().should('contain.text', '12 Hours');
    page.getMinTlsVersion().should('contain.text', 'TLSV1_2');
  });

  it('Check initial values are for time fields that have value of 1', () => {
    const getSecurityPolicyResponse = {
      account_lockout_time: 3600,
      permanent_lockout: true,
      session_idle_time: 3600,
      max_login_failures: 5,
      max_session_time: 86400,
    };

    initTest(getSecurityPolicyResponse);
    page.getStnMaxLoginFailure().should('contain.text', 5);
    page.getStnMaxSessionTime().should('contain.text', '1 Day');
    page.getStnSessionIdleTime().should('contain.text', '1 Hour');
    page.getStnPermanentLockout().should('contain.text', 'Enabled');
    page.getStnAccountLockoutTime().should('contain.text', '1 Hour');
    page.getMinTlsVersion().should('contain.text', 'TLSV1_2');
  });

  it('Check modal and form in it', () => {
    initTest(null);
    page.getEditBtn().click();
    modal.getMaxLoginFailureInput().should('have.value', 5);
    modal.getMaxLoginFailureInput().should('not.be.disabled');
    modal.getMaxSessionTimeInput().should('have.value', 1);
    modal.getMaxSessionTimeInput().should('not.be.disabled');
    modal.getSessionIdleTimeInput().should('have.value', 30);
    modal.getSessionIdleTimeInput().should('not.be.disabled');
    modal.getAccountLockoutTimeInput().should('have.value', 12);
    modal.getAccountLockoutTimeInput().should('be.disabled');

    modal
      .getPermanentLockoutCheckbox()
      .should('be.checked')
      .uncheck({ force: true });

    modal.getMaxLoginFailureInput().should('not.be.disabled');
    modal.getMaxSessionTimeInput().should('not.be.disabled');
    modal.getSessionIdleTimeInput().should('not.be.disabled');
    modal.getAccountLockoutTimeInput().should('not.be.

should('have.value', 1);
    modal.getMaxSessionTimeInput().should('not.be.disabled');
    modal.getSessionIdleTimeInput().should('have.value', 30);
    modal.getSessionIdleTimeInput().should('not.be.disabled');
    modal.getAccountLockoutTimeInput().should('have.value', 12);
    modal.getAccountLockoutTimeInput().should('be.disabled');

    modal
      .getPermanentLockoutCheckbox()
      .should('be.checked')
      .uncheck({ force: true });

    modal.getMaxLoginFailureInput().should('not.be.disabled');
    modal.getMaxSessionTimeInput().should('not.be.disabled');
    modal.getSessionIdleTimeInput().should('not.be.disabled');
    modal.getAccountLockoutTimeInput().should('not.be.disabled');

    modal
      .getPermanentLockoutCheckbox()
      .should('not.be.checked')
      .check({ force: true });

    modal.getAccountLockoutTimeInput().should('be.disabled');
  });

  it('Check values to be sent to BE', () => {
    initTest(null);
    cy.intercept({
      method: 'PATCH',
      pathname: '/api/v2/iam/config/security-policy',
      times: 1,
    }).as('patchSecurityPolicy');

    const patchPayload = {
      account_lockout_time: 43200,
      permanent_lockout: false,
      session_idle_time: 1800,
      max_login_failures: 10,
      max_session_time: 172800,
    };
    page.getEditBtn().click();
    modal.getMaxLoginFailureInput().clear().type('10');
    modal
      .getPermanentLockoutCheckbox()
      .should('have.value', 'on')
      .uncheck({ force: true });
    modal.getMaxSessionTimeInput().clear().type('2');
    cy.wait(3000);
    modal.getApplyBtn().click({ force: true });

    cy.wait('@patchSecurityPolicy').then(interception => {
      expect(interception.request.method).to.equal('PATCH');
      console.log(patchPayload);
      console.log(interception.request.body);
      expect(interception.request.body).to.deep.equal(patchPayload);
    });
  });

  it('Check reset action', () => {
    initTest(null);
    cy.intercept({
      method: 'POST',
      pathname: '/api/v2/iam/config/security-policy',
      times: 1,
    }).as('postSecurityPolicy');

    page.getResetBtn().click();
    cy.get('edf-modal')
      .should('exist')
      .should(
        'contain.text',
        'Are you sure you want to reset the security policy to its default state ?'
      )
      .find('.modal-title')
      .should('have.text', 'Reset Security Policy To Its Default State')
      .should('be.visible');

    cy.get('edf-modal').find('edf-button').contains('Cancel').click();
    cy.wait(500);
    cy.get('edf-modal').should('not.exist');

    page.getResetBtn().click();
    cy.get('edf-modal').find('edf-button').contains('Confirm').click();
    cy.wait(500);

    cy.get('edf-modal').should('not.exist');

    cy.get('ids-toast')
      .should('exist')
      .find('.toast-content')
      .find('.message')
      .should('contain.text', 'Security policy reset successfully.');

    cy.wait('@postSecurityPolicy').then(interception => {
      expect(interception.request.method).to.equal('POST');
    });
  });
});

